import React from "react";
import "./about.css";

const About = () => {
  return (
    <section className="about container section" id="about">
      <h2 className="section-title">- About Me</h2>
      <p className="des">(let me introduce myself to you (ﾟ▽ﾟ)/)</p>
      <p className="cover-letter">Hi,</p>
      <p className="cover-letter">
        I am Xi Lu. I have more than two-years of experience as a front-end
        developer. This includes the use of WordPress in creating website with
        HTML, CSS and JaveScript. Here is the details of what I did in the past.
      </p>
      <p className="cover-letter">
        Firstly, although I worked a lot on Wordpress, I also need to use code
        to meet the customers' special requirements, like how to make a banner
        or heading part more stunning. In the last two years, there were many
        aspects that I need to take care for the websites, including website
        templates, plugins, maintenance, SEO.{" "}
      </p>
    </section>
  );
};

export default About;
